            static_assert(INLINE_CACHE_ENTRIES_UNPACK_SEQUENCE == 1, "incorrect cache size");
            _PyStackRef seq_stackref;
            PyObject *seq;
            PyObject *val1;
            PyObject *val0;
            /* Skip 1 cache entry */
            seq_stackref = stack_pointer[-1];
            seq = PyStackRef_Get(seq_stackref);

